package document

import (
	"testing"
)

func newTestDocument() Document {
	doc := NewDoc("Test")
	doc.Snapshot = "Haha this is is some text"
	return doc
}

func TestDocumentRead(t *testing.T){
	doc := newTestDocument()
	target := "Haha this is is some text"
    result := doc.Snapshot
    if result != target{
        t.Errorf("Cannot read document got %q expected %q", result, target)
    }
}

func TestDocumentValidOps(t *testing.T) {
	doc := newTestDocument()
	target := "Hahaho this is some text"
	op1 := TextOp{Component{
		Position: 4,
		Insert:   "ho",
	}, Component{
		Position: 12,
		Delete:   "is ",
	}}
	err := doc.ApplyOps(op1, doc.Version)

	if err != true {
		t.Errorf("Simple Operation failed (Error %q)", err)
	}
	result := doc.Snapshot
	if result != target {
		t.Errorf("simple Operation failed %q != %q", result, target)
	}
}

func TestDocumentConcurrentLeft(t *testing.T) {
	doc := newTestDocument()
	target := "Hahaho this is some text"
	op1 := TextOp{Component{
		Position: 4,
		Insert: "ho",
	}}
	// Expecting Hahaho this is is some text
	op2 := TextOp{Component{
		Position: 7,
		Delete: "is ",
	}}
	// Expecting Haha this is some text
	// Combination of both should end up in Hahaho this is some text

	//RIGHT OP
	err := doc.ApplyOps(op2, doc.Version)
	if err != true {
		t.Errorf("Simple Operation failed (Error %q)", err)
	}
	err = doc.ApplyOps(op1, doc.Version)
	if err != true {
		t.Errorf("Concurrent Left Operation failed (Error %q)", err)
	}
	result := doc.Snapshot
	if result != target {
		t.Errorf("Concurrent Left Operation failed %q != %q", result, target)
	}
}

func TestConcurrentRight(t *testing.T) {
	doc := newTestDocument()
	target := "Haha this isho some text"
	check := doc.Version
	op1 := TextOp{Component{
		Position: 14,
		Insert:   "ho",
	}}
	// Expecting Hahaho this is is some text
	op2 := TextOp{Component{
		Position: 7,
		Delete: "is ",
	}}
	// Expecting Haha this is some text
	// Combination of both should end up in Hahaho this is some text

	//LEFT OP
	err := doc.ApplyOps(op1, check)
	if err != true {
		t.Errorf("Simple Operation failed (Error %q)", err)
	}
	err = doc.ApplyOps(op2, check)
	if err != true {
		t.Errorf("Concurrent Right Operation failed (Error %q)", err)
	}
	result := doc.Snapshot
	if result != target {
		t.Errorf("Concurrent Right Operation failed %q != %q", result, target)
	}

}

func TestInvalidDeletes(t *testing.T) {
	doc := newTestDocument()
	op := TextOp{Component{
		Position: 0,
		Delete:   "is ",
	}}
	err := doc.ApplyOps(op, doc.Version)
	if err != false {
		t.Error("Invalid DELETE did not raise error")
	}
}

func BenchmarkApplyInserts(b *testing.B) {
	doc := newTestDocument()
	op := TextOp{Component{
		Position: 0,
		Insert:   "ha ",
	}}
	for i := 0; i < b.N; i++ {
		doc.ApplyOps(op, doc.Version)
	}
}

func BenchmarkApplyDeletes(b *testing.B) {
	doc := newTestDocument()
	doc.Snapshot = ""
	op := TextOp{Component{
		Position: 0,
		Delete: "H",
	}}
	for i := 0; i < b.N; i++ {
		doc.ApplyOps(op, doc.Version)
	}
}